DECLARE CONTINUE HANDLER FOR NOT FOUND SET @EJECUTAR = TRUE;
    OPEN FACTURA_CURSOR;
    LOOP1: LOOP
    FETCH FACTURA_CURSOR INTO 
            CPP_Codigo,
              CPC_TipoOperacion,
