                SET @CUE_FlagEstadoPago='C';
                SET @CUE_FechaCanc=NOW();
            END IF;
            
            -- ? FORMAS DE PAGO QUE TENGAN CUENTAS POR COBRAR 
			SET @idcji_compro_forPa = (SELECT CFP.idcji_compro_forPa FROM cji_comprobante_formaspago CFP WHERE CFP.CPP_Codigo=CPP_Codigo AND CFP.FORPAP_Codigo=4);

            IF (@idcji_compro_forPa IS NOT NULL) THEN
                SET @CUE_FlagEstadoPago='A';
                SET @CUE_FechaCanc = NULL;
            END IF;
            

            SET @CUE_Codigo=(SELECT CC.CUE_Codigo FROM cji_cuentas CC WHERE CC.CUE_CodDocumento=CPP_Codigo LIMIT 1);
            
