            IF FORPAP_Codigo=1 THEN
                SET @PAGP_Codigo='';

                IF (@idcji_compro_forPa IS NOT NULL) THEN
				    -- Registro de entrada al IF
                    SET @PAGC_Monto = (SELECT CFP.monto FROM cji_comprobante_formaspago CFP WHERE CFP.CPP_Codigo=CPP_Codigo AND CFP.FORPAP_Codigo=1 limit 1);

