                        SET @PAGC_Obs = CONCAT(@PAGC_Obs," PAGO PARCIAL DE ",@PAGC_Monto);
                        CALL MANTENIMIENTO_PAGO(@PAGP_Codigo,@CUE_TipoCuenta,CPC_Fecha,CLIP_Codigo,PROVP_Codigo,@PAGC_TDC,@PAGC_Monto,MONED_Codigo,'1',NULL,NULL,NULL,NULL,NULL,NULL,'0',@PAGC_Obs,COMPP_Codigo,NULL,NULL,'1',0,NULL,NULL,NULL);
                        CALL MANTENIMIENTO_CUENTAPAGO('',@CUE_Codigo,@PAGP_Codigo,@PAGC_TDC,@PAGC_Monto,MONED_Codigo,NULL,NULL,'1',0,NULL,NULL,NULL,NULL,NULL);
