            END IF;  
            
            SET @SQLREALIZAR=CONCAT(@SQLREALIZAR," ORDER BY gs.CPDEP_Codigo ASC;");

            PREPARE STMT FROM @SQLREALIZAR; 
            EXECUTE STMT; 
            DEALLOCATE PREPARE STMT;
                
    END IF;
END$$

